script: |
  super -f text -I q10798.spq | sort > q10798.out

inputs:
  - name: q10798.spq
    data: |
      SELECT DISTINCT col0 * - cor0.col1 / col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + cor0.col1 - col0 * cor0.col1 NOT IN ( - col0 );
  - name: tab0

outputs:
  - name: q10798.out
    data: |
